import React from "react";
import Logo from "../../components/Logo";
import Goodiespagemember from "../../components/member/Goodiespagemember";
import Navigationmember from "../../components/member/Navigationmember";

const Goodiesmember = () => {
  return (
    <div>
      <Logo />
      <Navigationmember />
      <Goodiespagemember />
    </div>
  );
};

export default Goodiesmember;
